<script lang="ts">
    import { onDestroy, onMount } from 'svelte';
    import { GrandDataDistributor } from '$lib';

    let emergency_triggered: boolean = false;

    // Propulsion SubFSM
    let propulsion_off: SVGGElement;
    let propulsion_on: SVGGElement;
    let propulsion_running: SVGGElement;

    // Levitation SubFSM
    let levitation_off: SVGGElement;
    let levitation_on: SVGGElement;

    // High Voltage SubFSM
    let high_voltage_off: SVGGElement;
    let high_voltage_on: SVGGElement;

    // Motion Control SubFSM
    let stopped: SVGGElement;
    let demo: SVGGElement;
    let shut_down: SVGGElement;
    let accelerating: SVGGElement;
    let cruising: SVGGElement;
    let braking: SVGGElement;

    // Emergency Handling SubFSM
    let not_an_emergency: SVGGElement;
    let emergency: SVGGElement;
    let emergency_stop: SVGGElement;
    let emergency_shut_down: SVGGElement;

    let propStates: SVGGElement[];
    let leviStates: SVGGElement[];
    let hvStates: SVGGElement[];
    let operatingStates: SVGGElement[];
    let emergencyStates: SVGGElement[];
    let allStates: SVGGElement[][];

    const storeManager = GrandDataDistributor.getInstance().stores;
    const PropFsmState = storeManager.getWritable("PropFSMState");
    const LeviFsmState = storeManager.getWritable("LeviFSMState");
    const HVFsmState = storeManager.getWritable("HVFSMState");
    const OperatingFsmState = storeManager.getWritable("OperatingFSMState");
    const EmergencyFsmState = storeManager.getWritable("EmergencyFSMState");
    const mainFsmState = storeManager.getWritable("FSMState");

    function turn_on(state:SVGGElement) {
        if (!state || !state.style) return;
        if (emergency_triggered) {
            state.style.fill = '#D61111'
        } else {
            state.style.fill = '#0EA774'
        }
    }

    function turn_off_all(states:SVGGElement[][]) {
        states.forEach(a => a.forEach(s => {
            if (!s || !s.style) return;
            s.style.fill = 'none'
        }));
    }

    let interval: NodeJS.Timeout;

    onMount(() => {
        propStates = [
            propulsion_off,
            propulsion_on,
            propulsion_running
        ]

        leviStates = [
            levitation_off,
            levitation_on
        ]

        hvStates = [
            high_voltage_off,
            high_voltage_on
        ]

        operatingStates = [
            demo,
            accelerating,
            cruising,
            braking,
            stopped,
            shut_down
        ]

        emergencyStates = [
            not_an_emergency,
            emergency,
            emergency_stop,
            emergency_shut_down
        ]

        allStates = [
            propStates,
            leviStates,
            hvStates,
            operatingStates,
            emergencyStates
        ]

        interval = setInterval(() => {
            turn_off_all(allStates);

            emergency_triggered = $EmergencyFsmState.value % emergencyStates.length !== 0;

            if ($mainFsmState.value === 4) {
                turn_on(propStates[$PropFsmState.value % propStates.length]);
                turn_on(leviStates[$LeviFsmState.value % leviStates.length]);
                turn_on(hvStates[$HVFsmState.value % hvStates.length]);
                turn_on(operatingStates[$OperatingFsmState.value % operatingStates.length]);
                turn_on(emergencyStates[$EmergencyFsmState.value % emergencyStates.length]);
            }
        }, 100)
    })

    onDestroy(() => {
        clearInterval(interval)
    });
</script>

